import React from 'react';
import CourseEnrollmentPage from '../CourseEnrollment/CourseEnrollmentPage';

function CourseCatalog() {
  return (
    <div>
      <h1>Course Catalog</h1>
      <CourseEnrollmentPage />
    </div>
  );
}

export default CourseCatalog;
